A Superintendência Estadual do Turismo - SETUR/RO, visando cumprir com sua função constitucional e o princípio da eficiência, busca sempre manter em perfeito funcionamento as suas unidades administrativas com materiais permanentes, consumo e execução de serviços, no intuito de bem atender a população e servidores, dentro de sua previsão orçamentária e financeira.

Considerando que a Superintendência Estadual de Turismo – SETUR tem como missão apresentar, promover e fortalecer os produtos turísticos do Estado de Rondônia, fomentando a atividade turística e dando visibilidade às diversas segmentações existentes, como o ecoturismo, turismo cultural, de aventura, de negócios, entre outros;

Considerando os programas estratégicos de desenvolvimento do turismo estadual, como Rondônia Tem Turismo, Viva Rondônia, Rondônia Para Todos e Viaja Mais Servidor, entre outros, que visam impulsionar o setor por meio da valorização das potencialidades regionais e do incentivo à circulação interna e externa de visitantes;

Considerando que, para garantir a efetividade dessas ações e ampliar o alcance das políticas públicas de turismo, é imprescindível investir na promoção institucional, por meio da produção de materiais gráficos informativos e promocionais;

Destaca-se, portanto, a necessidade da aquisição de material gráfico destinado à divulgação dos atrativos turísticos de Rondônia, tanto em território estadual quanto em feiras e eventos do setor em âmbito nacional, como estratégia fundamental para o fortalecimento da imagem do Estado como destino turístico, contribuindo para o desenvolvimento econômico e social da região
